Seventeen-year-old Amy Ginart has disappeared. As part of the ongoing investigation, the police interrogate Amy’s schoolmates. Through their accounts, each audience member will form a unique image of who Amy is and the circumstances of her mysterious disappearance.

Regarding the Disappearance of Amy is a new play written by young emerging playwright Idalia Basterra, directed by award-winning director Kyle Pleasant and produced by Eduardo Jimenez Pons, that takes the experience of theater beyond the stage’s space and time.

This play will have its world premiere Off-Broadway this summer at the Peter Jay Sharp Theater, on 42nd St featuring a stellar cast of young Broadway, Off-Broadway, and Hollywood actors.
